column66:
Migliorare il servizio di trasporto pubblico così da poter ridurre il numero di mezzi privati nelle strade oppure incentivare l'utilizzo di veicoli elettrici o a basso consumo di carburante;
Migliorare anche l'infrastruttura idrica per evitare sprechi; 
Aumentare il numero di pannelli fotovoltaici nei tetti delle costruzioni
